For debugging purposes, we may want to inspect which RPC queries Hermes is making. Hermes makes use of the tendermint-rpc library to issue RPC queries, but the output of this library is by default turned off in order to keep the logs more readable. Using the RUST_LOG environment variable, we can turn logging on for the tendermint-rpc library, as follows: RUST_LOG=tendermint-rpc=debug,info hermes start Setting the RUST_LOG environment variable to tendermint_rpc=debug,info instructs Hermes to set the log level of the tendermint_rpc crate to debug and otherwise use the info log level. Note: While the tendermint-rpc contains a dash in its name, the logging filter expects a module name, which can only contain alphanumeric characters and underscores, hence why the filter above is written tendermint_rpc=debug. Example: ❯ RUST_LOG=tendermint_rpc=debug,info hermes start
