If the --json option is supplied, all commands will output single-line JSON values instead of plain text. Log messages will be written to stderr, while the final result will be written to stdout, and everything will be formatted as JSON. This allows processing only the final output using jq . To process all the output using jq, one can redirect stderr to stdout with hermes --json COMMAND 2>&1 | jq. Example hermes --json create client --host-chain ibc-0 --reference-chain ibc-1 {"timestamp":"Apr 13 20:46:31.921","level":"INFO","fields":{"message":"Using default configuration from: '.hermes/config.toml'"},"target":"ibc_relayer_cli::commands"}
{"timestamp":"Apr 13 20:46:31.961","level":"INFO","fields":{"message":"running listener","chain.id":"ibc-1"},"target":"ibc_relayer::event::monitor"}
{"timestamp":"Apr 13 20:46:31.989","level":"INFO","fields":{"message":"running listener","chain.id":"ibc-0"},"target":"ibc_relayer::event::monitor"}
{"result":{"CreateClient":{"client_id":"07-tendermint-1","client_type":"Tendermint","consensus_height":{"revision_height":10060,"revision_number":1},"height":{"revision_height":10072,"revision_number":0}}},"status":"success"} The first three lines are printed to stderr, while the last line with a "result" key is printed to stdout. Example To improve the readability, pipe all the output to jq: hermes --json create client --host-chain ibc-0 --reference-chain ibc-1 2>&1 | jq { "timestamp": "Apr 13 20:52:26.060", "level": "INFO", "fields": { "message": "Using default configuration from: '.hermes/config.toml'" }, "target": "ibc_relayer_cli::commands"
}
{ "timestamp": "Apr 13 20:52:26.082", "level": "INFO", "fields": { "message": "running listener", "chain.id": "ibc-1" }, "target": "ibc_relayer::event::monitor"
}
