{ "result": { "CreateClient": { "client_id": "07-tendermint-5", "client_type": "Tendermint", "consensus_height": { "revision_height": 10364, "revision_number": 1 }, "height": { "revision_height": 10375, "revision_number": 0 } } }, "status": "success"
} Example To extract the identifier of the newly created client above: hermes --json create client --host-chain ibc-0 --reference-chain ibc-1 | jq '.result.CreateClient.client_id' Which should output: "07-tendermint-2"

