The command keys add has two exclusive flags, --key-file and --mnemonic-file which are respectively used to add and restore a key. If a key with the same key_name already exists, the flag --overwrite must be passed in order to overwrite the existing key or else the command will abort. DESCRIPTION:
Add a key to a chain from its keyring file or restore a key using its mnemonic USAGE: Add a key from a Comet keyring file: hermes keys add [OPTIONS] --chain <CHAIN_ID> --key-file <KEY_FILE> Add a key from a file containing its mnemonic: hermes keys add [OPTIONS] --chain <CHAIN_ID> --mnemonic-file <MNEMONIC_FILE> On *nix platforms, both flags also accept `/dev/stdin` as a value, which will read the key or the mnemonic from stdin. OPTIONS: -h, --help Print help information --hd-path <HD_PATH> Derivation path for this key [default: m/44'/118'/0'/0/0] --key-name <KEY_NAME> Name of the key (defaults to the `key_name` defined in the config) --overwrite Overwrite the key if there is already one with the same key name FLAGS: --chain <CHAIN_ID> Identifier of the chain --key-file <KEY_FILE> Path to the key file, or /dev/stdin to read the content from stdin --mnemonic-file <MNEMONIC_FILE> Path to file containing the mnemonic to restore the key from, or /dev/stdin to read the mnemonic from stdin Add a private key to a chain from a key file hermes keys add --chain <CHAIN_ID> --key-file <PRIVATE_KEY_FILE> The content of the file key should have the same format as the output of the gaiad keys add command: { "name": "testkey", "type": "local", "address": "cosmos1tc3vcuxyyac0dmayf887t95tdg7qpyql48w7gj", "pubkey": "cosmospub1addwnpepqgg7ng4ycm60pdxfzdfh4hjvkwcr3da59mr8k883vsstx60ruv7kur4525u", "mnemonic": "[24 words mnemonic]"
} If the command is successful a message similar to the one below will be displayed: Success: Added key testkey (<ADDRESS>) on <CHAIN_ID> chain Key name: By default, the key will be named after the key_name property specified in the configuration file. To use a different key name, specify the --key-name option when invoking keys add. hermes keys add --key-name [KEY_NAME] --chain <CHAIN_ID> --key-file <PRIVATE_KEY_FILE> Restore a private key to a chain from a mnemonic hermes keys add --chain <CHAIN_ID> --mnemonic-file <MNEMONIC_FILE> or using an explicit derivation path , for example an Ethereum coin type (used for Evmos, Injective, Umee, Cronos, and possibly other networks): hermes keys add --hd-path "m/44'/60'/0'/0/0" --chain <CHAIN_ID> --mnemonic-file <MNEMONIC_FILE> The mnemonic file needs to have the 24 mnemonic words on the same line, separated by a white space. So the content should have the following format: word1 word2 word3 ... word24 If the command is successful a message similar to the one below will be displayed: Success: Restore key testkey (<ADDRESS>) on <CHAIN_ID> chain Key name: By default, the key will be named after the key_name property specified in the configuration file. To use a different key name, specify the --key-name option when invoking keys add. hermes keys add --key-name <KEY_NAME> --chain <CHAIN_ID> --mnemonic-file <MNEMONIC_FILE>

