v3.0.0+ Packet forwarding middleware introduced Packet forwarding allows a Chain to send a packet to another chain without having a direct channel. This means that if there are three Chains A, B and C, with the following channels: flowchart LR A((ibc-0))---B((ibc-1))---C((ibc-2)) Then if the IBC packet forward middleware is active, Chain A can send a packet to Chain C, by including the following memo: { "forward": { "receiver": "chain-c-bech32-address", "port": "transfer", "channel": "channel-123" }
} If there are four Chains A, B, C and D, with the following channels: flowchart LR A((ibc-0))---B((ibc-1))---C((ibc-2))---D((ibc-3)) Then if the IBC packet forward middleware is active, Chain A can send a packet to Chain D, by including the following memo: { "forward": { "receiver": "chain-c-bech32-address", "port": "transfer", "channel": "channel-a-to-b", "timeout": "10m", "retries": 2, "next": { "forward": { "receiver": "chain-d-bech32-address", "port": "transfer", "channel":"channel-c-to-d", "timeout":"10m", "retries": 2 } } }
}

