Use the query clients command to query the identifiers of all clients on a given chain, called the host chain. DESCRIPTION:
Query the identifiers of all clients on a chain USAGE: hermes query clients [OPTIONS] --host-chain <HOST_CHAIN_ID> OPTIONS: -h, --help Print help information --omit-chain-ids Omit printing the reference (or target) chain for each client --reference-chain <REFERENCE_CHAIN_ID> Filter for clients which target a specific chain id (implies '--omit-chain-ids') REQUIRED: --host-chain <HOST_CHAIN_ID> Identifier of the chain to query Example Query all clients on ibc-1: hermes query clients --host-chain ibc-1 Success: [ ClientChain { client_id: ClientId( "07-tendermint-0", ), chain_id: ChainId { id: "ibc-0", version: 0, }, }, ClientChain { client_id: ClientId( "07-tendermint-1", ), chain_id: ChainId { id: "ibc-2", version: 2, }, },
] Query all clients on ibc-1 having ibc-2 as their reference chain: hermes query clients --reference-chain ibc-2 --host-chain ibc-1 Success: [ ClientId( "07-tendermint-1", ),
]

