Use the query client state command to query the client state of a client: DESCRIPTION:
Query the client state USAGE: hermes query client state [OPTIONS] --chain <CHAIN_ID> --client <CLIENT_ID> OPTIONS: -h, --help Print help information --height <HEIGHT> The chain height context for the query REQUIRED: --chain <CHAIN_ID> Identifier of the chain to query --client <CLIENT_ID> Identifier of the client to query Example Query the state of client 07-tendermint-2 on ibc-1: hermes query client state --chain ibc-1 --client 07-tendermint-1 Success: ClientState { chain_id: ChainId { id: "ibc-2", version: 2, }, trust_threshold: TrustThresholdFraction { numerator: 1, denominator: 3, }, trusting_period: 1209600s, unbonding_period: 1814400s, max_clock_drift: 3s, frozen_height: Height { revision: 0, height: 0, }, latest_height: Height { revision: 2, height: 3069, }, upgrade_path: [ "upgrade", "upgradedIBCState", ], allow_update_after_expiry: true, allow_update_after_misbehaviour: true,
}

