Use the query client consensus command to query the consensus states of a given client, or the state at a specified height: DESCRIPTION:
Query the client consensus state USAGE: hermes query client consensus [OPTIONS] --chain <CHAIN_ID> --client <CLIENT_ID> OPTIONS: --consensus-height <CONSENSUS_HEIGHT> Height of the client's consensus state to query -h, --help Print help information --height <HEIGHT> The chain height context to be used, applicable only to a specific height REQUIRED: --chain <CHAIN_ID> Identifier of the chain to query --client <CLIENT_ID> Identifier of the client to query Example Query the states of client 07-tendermint-0 on ibc-0: hermes query client consensus --chain ibc-0 --client 07-tendermint-0 Success: [ Height { revision: 1, height: 3049, }, Height { revision: 1, height: 2888, }, Height { revision: 1, height: 2736, }, Height { revision: 1, height: 2729, }, Height { revision: 1, height: 2724, }, Height { revision: 1, height: 2717, },
] Query ibc-0 at height 2800 for the consensus state for height 2724: hermes query client consensus --consensus-height 2724 --height 2800 --chain ibc-0 --client 07-tendermint-0 Success: ConsensusState { timestamp: Time( 2021-04-13T14:11:20.969154Z ), root: CommitmentRoot( "371DD19003221B60162D42C78FD86ABF95A572F3D9497084584B75F97B05B70C" ), next_validators_hash: Hash::Sha256( 740950668B6705A136D041914FC219045B1D0AD1C6A284C626BF5116005A98A7 ),
}

