Query the client connections USAGE: hermes query client connections [OPTIONS] --chain <CHAIN_ID> --client <CLIENT_ID> OPTIONS: -h, --help Print help information --height <HEIGHT> The chain height which this query should reflect REQUIRED: --chain <CHAIN_ID> Identifier of the chain to query --client <CLIENT_ID> Identifier of the client to query Example Query the connections of client 07-tendermint-0 on ibc-0: hermes query client connections --chain ibc-0 --client 07-tendermint-0 Success: [ ConnectionId("connection-0"), ConnectionId("connection-1"),
]

