DESCRIPTION:
Query for the header used in a client update at a certain height USAGE: hermes query client header [OPTIONS] --chain <CHAIN_ID> --client <CLIENT_ID> --consensus-height <CONSENSUS_HEIGHT> OPTIONS: -h, --help Print help information --height <HEIGHT> The chain height context for the query. Leave unspecified for latest height. REQUIRED: --chain <CHAIN_ID> Identifier of the chain to query --client <CLIENT_ID> Identifier of the client to query --consensus-height <CONSENSUS_HEIGHT> Height of header to query Example Query for the header used in the 07-tendermint-0 client update at height 2724 on ibc-0: hermes query client header --chain ibc-0 --client 07-tendermint-0 --consensus-height 2724 Success: [ UpdateClient( UpdateClient { common: Attributes { height: Height { revision: 0, height: 0, }, client_id: ClientId( "07-tendermint-0", ), client_type: Tendermint, consensus_height: Height { revision: 1, height: 2724, }, }, header: Some( Tendermint(...), ), }, ),
]

