Use the query connection end command to query the connection end: DESCRIPTION:
Query connection end USAGE: hermes query connection end [OPTIONS] --chain <CHAIN_ID> --connection <CONNECTION_ID> OPTIONS: -h, --help Print help information --height <HEIGHT> Height of the state to query. Leave unspecified for latest height. REQUIRED: --chain <CHAIN_ID> Identifier of the chain to query --connection <CONNECTION_ID> Identifier of the connection to query [aliases: conn] Example Query the connection end of connection connection-1 on ibc-1: hermes query connection end --chain ibc-1 --connection connection-1 Success: ConnectionEnd { state: Open, client_id: ClientId( "07-tendermint-1", ), counterparty: Counterparty { client_id: ClientId( "07-tendermint-0", ), connection_id: Some( ConnectionId( "connection-0", ), ), prefix: ibc, }, versions: [ Version { identifier: "1", features: [ "ORDER_ORDERED", "ORDER_UNORDERED", ], }, ], delay_period: 0s,
}

