Use the query packet pending command to query the sequence numbers of all packets that have not yet been received or acknowledged, at both ends of a channel. DESCRIPTION:
Output a summary of pending packets in both directions USAGE: hermes query packet pending --chain <CHAIN_ID> --port <PORT_ID> --channel <CHANNEL_ID> OPTIONS: -h, --help Print help information REQUIRED: --chain <CHAIN_ID> Identifier of the chain at one end of the channel --channel <CHANNEL_ID> Channel identifier on the chain given by <CHAIN_ID> [aliases: chan] --port <PORT_ID> Port identifier on the chain given by <CHAIN_ID> Example Query the sequence numbers of all packets that either not yet been received or not yet been acknowledged, at both ends of the channel channel-1. hermes query packet pending --chain ibc-0 --port transfer --channel channel-1 Success: Summary { forward: PendingPackets { unreceived_packets: [ 2203, ... 2212, ], unreceived_acks: [ 2183, ... 2202, ], }, reverse: PendingPackets { unreceived_packets: [ 14, ... 23, ], unreceived_acks: [ 4, ... 13, ], },
}

